import { Routes, Route } from "react-router-dom";
import { Home } from "./components/home/home";
import { Login } from "./components/login/login";
import { SecureRoute } from "./util/secureRoute";
import { NotAuthorized } from "./components/notAuthorized/notAuthorized";


function App() {

  return (
    <Routes>
      <Route path="/" element={<SecureRoute Route = {<Home />} LoggedIn={true} roles={["admin"]} Redirect="/login" />} />
      <Route path="/login" element={<SecureRoute Route = {<Login />} LoggedIn={false} roles={["admin", "user"]} Redirect="/" />} />
      <Route path="/not-authorized" element={<SecureRoute Route = {<NotAuthorized />} LoggedIn={false} roles={["admin", "user"]} />} />
    </Routes>
  );
}

export default App;
